Bei @armanibeauty wird der Black Friday zum Blue Friday! Sichert euch 30% Rabatt mit dem Code: BLUEFRIDAY23. Gleichzeitig unterstützt ihr die von Armani ins Leben gerufene ‘Aqua for Life’-Initiative, denn 30% der Einnahmen werden an diese gespendet. Seit ihrer Gründung im Jahr 2010 hat die Initiative bereits über 800.000 Menschen mit sauberem Trinkwasser versorgt und plant, bis 2030 über eine Million Menschen zu erreichen 😍👏🏾! 
Schaue auf armanibeauty.de und finde dein Produkt! 

Anzeige / #armanibeauty #acquaforlife #acquadigio #fragrance

By @dirk_the_director_ 
@ruankotze01 
@teega_michl 
@cinematic_sam
